        right: 0;

        display: -ms-flexbox;

        display: -webkit-box;

        -ms-flex-align: center;
        align-items: center;
      }
      
      .logo > svg {
        width: 100%;
        height: 100%;

      #stage {

        margin-top: 20px;

 the queries and functions\nreceive the same input data.\n\nProperties `when` and `whenData` can take:\n\n- a string – treated as a query\n- `true` – treated as a empty query which mean that the data itself is examinated with no any transformation\n- `undefined` – same when not specified, just render (ignore the property)\n- a function like `fn(data, context)`\n- any other value used as is\n\nRegardless of how the value is obtained, it is coerce to a boolean.\nPlase note, that Jora rules are used which mean that empty arrays and object with no own keys are falsy (truthy in JavaScript).\nThe view is only rendered if the resulting value is truthy.\n\n## Queries for properties\n\nIn some cases, it is necessary to compute the value of a property based on the data.\nTo do this, you can use a string value for a property that starts with `=`.\nThis will mean that everything after the `=` is a query which will take output data and produce a value for the property.\nOther values are passed to the view render as is, without any changes.\n\nIn the following, limit number of items rendered at once only if there are more than 12 items:\n\n```discovery-view\n{\n    view: 'list',\n    limit: '=size() <= 12 and 10'  // the same as '=size() <= 12 ? false : 10'\n}\n```\n\n> Note: In those rare cases when you need to pass to a property a string that starts with `=`,\nyou can use a query like `=\"=some string\"`,<br>e.g. `{ view: 'example', prop: '=\"=string=\"' }`\n\n## Shorthand notations\n\n| Shorhand notation | Expanding into ... |\n| --- | --- |\n| `'name'` | `{ view: 'name' }`\n| `'name:<query>'` | `{ view: 'name', data: '<query>' }`\n| `'name{ foo: size() / 2, bar: \"qux\" }'` | `{ view: 'name', foo: '=size() / 2', bar: 'qux' }`\n\n## List of views\n\nIf you need to specify a list of views, then you must use an array.\nAn array with view definitions can be passed anywhere a view is accepted as a value.\n\n```discovery-view\n[\n    {\n        view: 'list',\n        item: [\n            'text:name',\n            { view: 'badge', data: 'something.size()' }\n        ]\n    },\n    'table{ limit: 10 }'\n]\n```\n";function la(e){e.page.define("views-showcase",{view:"context",data:()=>[...e.view.values],modifiers:[{view:"block",className:"sidebar",content:{view:"content-filter",content:{view:"menu",name:"view",limit:!1,data:"\n                            .[name ~= #.filter]\n                            .sort(name asc)\n                            .({ ..., disabled: no options.usage })\n                        ",item:"text-match:{ text: name, match: #.filter }"}}}],content:{view:"block",className:"content",data:"$[=> name=(#.view.name or #.id)]",content:{view:"switch",content:[{when:"no $ and #.id",content:'alert-warning:"View \\"" + #.id + "\\" not found"'},{when:"no $",content:['h1:"Views showcase"','alert:"← Select a view to get details"',{view:"markdown",source:sa}]},{content:[{view:"context",postRender:function(t,n,i,r){e.setPageRef(i.name),e.cancelScheduledRender(),r.id=e.pageRef}},ia(e)]}]}}},{sidebar:!1})}function ca(e,t){const n=lt("style",null,":host{display:none}"),i=new Set;let r=Promise.resolve();return Array.isArray(t)&&(e.append(...t.map((e=>{switch("string"==typeof e&&(e={type:"style",content:e}),e.type){case"style":return lt("style",null,e.content);case"link":{let t,r,o=new Promise(((e,n)=>{t=e,r=n}));return i.add(o),lt("link",{rel:"stylesheet",href:e.href,media:e.media,onerror(e){i.delete(o),r(e),i.size||n.remove()},onload(){i.delete(o),t(),i.size||n.remove()}})}default:throw new Error(`Unknown type "${e.type}" for a style descriptor`)}}))),i.size&&(r=Promise.all(i),e.append(n))),r}function ua(e,t){if(null===e)return!0;for(const n of["top","left","width","height"])if(e[n]!==t[n])return!0;return!1}const da=e=>{let t,n=!1,i=null,r=null,o=null,a=null,s=0;const l=new Set,c=new Map,u=new Map,d=lt("div","cancel-hint view-alert view-alert-warning"),p=lt("div",{class:"discovery-view-inspector-overlay",onclick:()=>m(r&&!o?r:null)},[d]),h=     <script>
      setStage('Parsing', () => {
        for (const element of document.querySelectorAll('script')) {
          if(element.dataset.id) {
            jsonExtAPIName.pushChunk(element.dataset.id, element.innerText);
            // cleanup script-tags to free memory
            element.remove();
          }
        }
        
        const initFunction = function (data) {
            Statoscope.default(data.map((item) => ({ name: item.id, data: item.data })));
          };
        
        jsonExtAPIName.parse()
          .then(items => {
            setStage('Initialization', () => {
              initFunction(items);
              document.querySelector('#loading').remove();
            });
          });
      })
    </script>
